    <div className="Menu">
        <h1>
            ГЕРОЙ
        </h1>
        <h2>
            МОНЕТКИ
        </h2>
        <h3>
            ЭНЕРГИЯ
        </h3>
        <h4>
            КАРТА
        </h4>
        <h5>
            ПОКЕМОНЫ
        </h5>
        <h6>
            НАСТРОЙКИ
        </h6>
    </div>
);
};

export default MainMenu;
